const stringOptions = [
  // From 1st to top string (highest to lowest)
  {
    name: "6 string",
    indices: [7, 2, 10, 5, 0, 7],
  },
  {
    name: "7 string",
    indices: [7, 2, 10, 5, 0, 7, 2],
  },
  {
    name: "8 string",
    indices: [7, 2, 10, 5, 0, 7, 10, 0],
  },
];

export default stringOptions;
